/// Resolve a Lucide icon by kebab-case name.
///
/// Returns null if the icon is not found.
///
/// This also handles snake_case names by converting them to kebab-case.
///
/// Example:
/// ```dart
/// resolveLucideIcon('arrow-left')  // LucideIcons.arrowLeft
/// resolveLucideIcon('arrow_left')  // LucideIcons.arrowLeft
/// resolveLucideIcon('not-found')   // null
/// ```
IconData? resolveLucideIcon(String name) {
  // Normalize to kebab-case
  final kebabName = name.replaceAll('_', '-');
  return lucideIconMap[kebabName];
}
